import React from "react";
import Table from "../Table/Table";
import "./MainDash.css";

const MainDash = ({ setSelectedSidebarItem }) => {
  return (
    <div className="MainDash">
      <Table setSelectedSidebarItem={setSelectedSidebarItem} />
    </div>
  );
};

export default MainDash;
